webpackJsonp([0xdc42cd48c92e],{301:function(e,a){e.exports={data:{post:{title:"Edition 19 (4/11/2018)",content:'<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Hey Friends,</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Hope you&rsquo;re all having a great Wednesday. Thank you for tuning back in for another edition of our newsletter. Be on the lookout next week, as we&rsquo;ll be transitioning to an easy-to-read format! (Yes, our current format has been rather egregious and we acknowledge that)</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">From a content perspective, we&rsquo;ve taken things pretty granular in recent weeks. Today we&rsquo;re zooming out to focus our attention on the largest market participants, namely governments and central banks, as they grapple with evolving market conditions.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Without further ado, let&rsquo;s get after it.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><u>Boxed In</u></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Over the past few weeks, domestic equity markets have bounced around wildly but haven&rsquo;t chosen an overarching direction for traders, or for us as broader analysts, to hone in on. The below chart shows just how&nbsp;<em>boxy&nbsp;</em>action has been in the S&amp;P 500 futures over this time frame. Concessions in on-going trade negotiations could help solidify a broader up-move &ndash; as we observed yesterday &ndash; but if we know anything at this stage, it&rsquo;s that nothing is to be trusted definitively.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><span style="color:#14171a"><img alt="https://pbs.twimg.com/media/DaYlVAWUQAAmXU4.jpg:large" class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_7" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.1&amp;disp=emb&amp;attbid=ANGjdJ_gQN_Fh53QsPeevxSmGOVmnsth5lhQD5BZqz15HBIz7wtfRH1ZZRtT0rVV7NLZ294fYTeUKC2bKP3Heghed25JkaNHGgPV9wTqO0WNAXpQVT6feLit1jqVUqY&amp;sz=w836-h894&amp;ats=1523932795033&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:447px; outline:0px; width:418px" /></span></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><u>(</u><a href="https://twitter.com/canuck2usa/status/983514613663739904" style="color:#1155cc" target="_blank">chart credit</a><u>)</u></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><u>Fed Watch</u></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Part of our on-going analysis of broader market conditions inevitably returns us to the Federal Reserve. It&rsquo;s important to note that volatility in the equity markets has coincided with Federal Reserve efforts to liquidate balance sheet assets. Whereas the Fed spent the last near-decade buying assets &ndash; mostly U.S. treasuries during QE programs &ndash; it must now unwind its balance sheet, aka sell these accumulated assets.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">This transition from buying pressure to selling pressure will represent a headwind for equity markets and bond markets alike. See the below charts depicting changes in the Fed&rsquo;s assets over time:</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><img class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_6" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.2&amp;disp=emb&amp;attbid=ANGjdJ_narwymLDmwSmoDsoO1P6ZG7G6DPkyIc7EpdcmZAWQeSWbLzlrmEZZfceCInkmBTzGof8bCrm8Rfppj8JyLAotrhd8pSFLSwzITERxpCg0MIWC7TpzhJqXZOY&amp;sz=w1246-h502&amp;ats=1523932795034&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:251px; outline:0px; width:623px" /></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><img class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_5" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.3&amp;disp=emb&amp;attbid=ANGjdJ9qCqVmHDVJmGuAfChqlXBijFQU3S_28J__G6_SNttwU6WaDWy0NHfGwo8EAj1V_D8N5rRsyr164SsPcBD_mQzXnKbrKWEMPHYAHql67XwonsdVdJAQKWt1DAs&amp;sz=w1246-h502&amp;ats=1523932795034&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:251px; outline:0px; width:623px" /></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">The two timeframes here show very different stories. The first depicts the gargantuan increases in the Fed&rsquo;s asset levels that came in response to the Great Recession (2008-). These asset increases were driven by quantitative easing programs 1-3. We&rsquo;ve covered these previously in edition&nbsp;<a href="https://siyucapital.com/newsletters/4/" style="color:#1155cc" target="_blank">3</a>&nbsp;of this brief.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Taken in the context of the first graph, the second graph shows the&nbsp;<em>slow</em>&nbsp;and&nbsp;<em>miniscule&nbsp;</em>decline in Fed assets so far over the last 3 quarters, the timeframe in which the Fed has talked up efforts to wind down its balance sheet. The Fed often calls this long-term goal of selling its post-crisis assets &ldquo;<a href="https://mises.org/library/balance-sheet-normalization-or-not" style="color:#1155cc" target="_blank">Balance Sheet Normalization</a>.&rdquo;</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Look back at the first chart. In the context of the assets the Fed acquired over the last decade, recent liquidation of assets barely registers from a big picture perspective.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">While we can&rsquo;t opine directly about correlation, but if the Fed&rsquo;s absence as a major asset&nbsp;<em>buyer</em>&nbsp;in recent months has contributed to the shudders in markets, price movement and volatility could become all the more serious if the Fed sells its assets in greater volume.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">The other problem with this ballooned balance sheet is that it limits the Fed&rsquo;s options in the future. Given how many assets the Fed already owns, it&rsquo;s hard to imagine them initiating the same style of asset purchasing programs all over again if economic growth slows.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><u>Deficit Watch</u></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">In brief&nbsp;<a href="https://siyucapital.com/newsletters/13/" style="color:#1155cc" target="_blank">12</a>, we outlined the long-run impacts a ballooning national deficit could have on equity and bond markets. The ultimate concern with an analysis of this kind is, of-course, focused on the solvency of the U.S. itself. Pursuant to this, an interesting tidbit came to our attention this week.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Deficit hawks often point to the outlandish size of U.S. military expenditures, and how these contribute disproportionately to the size of the government&rsquo;s budget deficit. This week however, we learned by way of Congressional Budget Office (CBO) projections that by 2023, the U.S. will be spending more financing interest payments on existing debt than it will be on military (&ldquo;Defense&rdquo;) spending. See below:</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><span style="color:#14171a"><img alt="https://pbs.twimg.com/media/DaXKdjxV4AAx4p9.jpg:large" class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_4" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.4&amp;disp=emb&amp;attbid=ANGjdJ-u4M2fWtUh789qdLPe5LaEMyekjtnnovLzHTFZYHV7lfR69mHyjqvsUuD7qpfbwu4soWS9yHIoPeQ6DUdwXNRT3egu_WQID_Cz5gXKhVxrU4BQ-BvsS5Qqyew&amp;sz=w1184-h614&amp;ats=1523932795035&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:307px; outline:0px; width:592px" /></span></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">(<a href="https://twitter.com/NickTimiraos/status/983414709423628288" style="color:#1155cc" target="_blank">credit</a>)</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Meanwhile, by 2025, net interest payments (the money owed to service existing debt obligations and avoid default) will exceed&nbsp;<em>non</em>defense<em>&nbsp;</em>discretionary spending as well.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">The troubling part of this picture is that a budget surplus in the short-run seems highly unlikely. The deficit will continue to grow, and net interest payments will grow in parallel &ndash; as evidenced by the CBO&rsquo;s projections out to 2028.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">We have to question at what point this cycle might become unsustainable. At current, the U.S. can borrow cheaply as treasury yields remain at reasonable historical levels (these yields represent the interest the U.S. will owe when it has to pay off treasuries as they come due). However, if our creditors begin to question long-term solvency, they may demand higher interest payments to compensate for greater perceived risk.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">And in turns out, they are. China, the&nbsp;<em>largest</em>&nbsp;foreign creditor of the U.S. in terms of treasuries owned, downgraded the U.S.&rsquo;s credit rating this month:</span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">&ldquo;China&#39;s most prominent rating agency, Dagong Global, downgraded Treasuries to BBB+, with a negative outlook, in early 2018.&rdquo;1</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">China&nbsp;<a href="https://www.investopedia.com/articles/investing/080615/china-owns-us-debt-how-much.asp" style="color:#1155cc" target="_blank"><span style="color:#1155cc">owns</span></a>&nbsp;$1.17T worth of Treasuries, which represents ~ 6% of the national deficit.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Here&rsquo;s a quick breakdown of credit ratings; different agencies have slightly different ratings they assign to indicate credit worthiness:</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><img class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_3" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.5&amp;disp=emb&amp;attbid=ANGjdJ8PqZ2sDBgPxILPu6waJjMnorCeTzAgKRDr-SmxN44_hAwTpoyZM5Hgxz8C1NpNes8QwygHEyzmpJvtZ_y9JJwHlkBRJ17KwRgBD-KhUmt1B7vhE2Co2tlm4pg&amp;sz=w1034-h682&amp;ats=1523932795036&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:341px; outline:0px; width:517px" /></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">In case you don&rsquo;t remember, or were too young to care, the USA actually doesn&rsquo;t carry a AAA rating with one of its own top domestic ratings agencies During the Obama administration, Standard and Poor&rsquo;s downgraded the U.S.&rsquo;s credit rating from the highest rating, AAA, to AA+, one notch below. Countries with AAA credit ratings include Germany and Switzerland. Per S&amp;P, the U.S. also currently carries a<a href="https://countryeconomy.com/ratings/usa" style="color:#1155cc" target="_blank">negative outlook.</a></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">So what does Dagong Global&rsquo;s BBB+ rating mean? Well, it&rsquo;s not necessarily ideal. In the US, ratings below BBB are considered to be below investment grade. The Dagong rating system is implying that Treasuries are reaching the lower bound of investment worthy credit.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><u>Global Central Bank Watch</u></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">While we&rsquo;ll often outline the activities of the Federal Reserve as their actions and economic forecasts impact markets, it&rsquo;s worth looking at how other Central Banks worldwide are engaging with economic challenges in their own countries.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Japan, home of the&nbsp;<a href="https://www.sciencedirect.com/science/article/pii/1061951895900047" style="color:#1155cc" target="_blank">100-year mortgage</a>, faces its own unique economic challenges. The Japanese central dubbed the &ldquo;BOJ,&rdquo; shorthand for the Bank of Japan, has gone on a fully unparalleled open market buying spree over the course of the last decade.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">To give some broader context, following the Japanese asset price bubble of the early 1990s, the country began to experience systematic economic hardships with nominal GDP falling nearly $1T from 1995 to 2007, and real wages falling ~5%. Unsurprisingly, this period &mdash; which has sort of bled into recent times as well &mdash; has been dubbed the &ldquo;Lost Decade&rdquo; or &ldquo;Lost 20 Years.&rdquo; For more on this, read&nbsp;<a href="https://en.wikipedia.org/wiki/Lost_Decade_(Japan)" style="color:#1155cc" target="_blank"><span style="color:#1155cc">here</span></a>.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">One barometer for this economic stagnation can be seen in the Nikkei&rsquo;s (Japan&rsquo;s largest equity market) performance below over the time frame:</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><strong><span style="color:red"><img class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_2" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.6&amp;disp=emb&amp;attbid=ANGjdJ_wjGmTJoFt0uyTiXvPcAl-nmNtH-nRFIZeDjXuvYPLqzrjT6JQ6y_aWYCkXVOGyiGuPe4UaG9RELRVZcLCW222cdfh6-zdDSUKflynZw1ssUo5XjvTUI6nCp8&amp;sz=w740-h496&amp;ats=1523932795036&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:248px; outline:0px; width:370px" /></span></strong></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><strong>(</strong><a href="https://qz.com/1103091/nikkei-225-the-japanese-stock-markets-20-year-high-is-still-around-50-below-its-1989-peak/" style="color:#1155cc" target="_blank"><strong><span style="color:#1155cc">chart credit</span></strong></a><strong>)</strong></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Unsurprisingly, in the wake of the Great Recession &mdash; coupled with the effects of the previous 10+ years of economic malaise &mdash; the BOJ took&nbsp;<em>drastic&nbsp;</em>measures to spur economic growth. The attack plan involved a massive quantitative easing program that sought to prop up the world&rsquo;s 3rd largest economy. (We&rsquo;ve discussed quantitative easing several times before, but for a refresher: see&nbsp;<a href="https://www.investopedia.com/terms/q/quantitative-easing.asp" style="color:#1155cc" target="_blank"><span style="color:#1155cc">here</span></a>).</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">What have the results been like?</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Given the record open-market bond purchases that Kuroda has spearheaded as head of the Japanese central bank, there has been a &ldquo;crowding-out&rdquo; effect; Japanese government bonds simply aren&rsquo;t being traded by individual traders or firms. As a drastic illustration of this, on March 13th, not a single 10-year Japanese government bond&nbsp;<a href="https://www.bloomberg.com/news/articles/2018-03-14/not-a-single-japanese-10-year-bond-traded-tuesday-death-by-boj" style="color:#1155cc" target="_blank">traded on Japanese exchanges</a>. Make no mistake, this is a mind-boggling development.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">The overarching downtrend in trading volume in Japanese government bonds can be seen below:</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><span style="color:#3c3c3c"><img alt="https://assets.bwbx.io/images/users/iqjWHBFdfxIU/ileltmsDkSm8/v2/800x-1.png" class="CToWUd a6T" id="m_9054706457189498113Picture_x0020_1" src="https://mail.google.com/mail/u/0/?ui=2&amp;ik=998c65c245&amp;view=fimg&amp;th=162b5d0fe583a1a1&amp;attid=0.7&amp;disp=emb&amp;attbid=ANGjdJ-NM4HmKFy4AiSvIfbxlEqGgsewfav-c1juIQAnYgcWkYAdNctVVXWWEtGOr190vcFLuG2bqMhF2C3fQyLRJ0PfpEsMc7GHvPHl-Yve07lVMXEzkTZiJ5SnEEs&amp;sz=w1088-h612&amp;ats=1523932795037&amp;rm=162b5d0fe583a1a1&amp;zw&amp;atsh=1" style="cursor:pointer; height:306px; outline:0px; width:544px" /></span></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff"><a name="m_9054706457189498113__gjdgxs"></a>One concern that declining volume raises pertains to market efficiency. As volumes decline, we become less and less sure that prices are being &ldquo;vetted&rdquo; enough; lower volume indicates less market participation, and as a result implicitly implies less due diligence and analysis by market participants.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Nor is the BOJ done buying securities in the open market:</span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">&ldquo;According to Bloomberg calculations, in the turbulent month of March which saw the Nikkei tumble&hellip;the Bank of Japan spent a record 833 billion yen ($7.8 billion) it had printed out of thin air to buy ETFs tracking the country&rsquo;s shares, the largest amount ever according to data (reaching) back to 2010.&rdquo;2</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">The BOJ&rsquo;s continued intervention raises the same concerns we outlined earlier in our analysis of the Fed; if and when central bank intervention stops &ndash; and even reverses as previously purchased assets are sold back to reduce balance sheet holdings &ndash; how will markets respond?</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">It is perhaps most evident in the case of Japan that central bank liquidity has helped prop up decade long accumulations in asset values. The real question becomes how much of the markets&rsquo; accumulation has been predicated on central bank intervention. Were recent market gains driven by economic fundamentals, or not?</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">We can never know, but we&rsquo;ll leave this (seemingly timeless) link&nbsp;<a href="https://www.oaktreecapital.com/docs/default-source/memos/there-they-go-again-again.pdf" style="color:#1155cc" target="_blank"><span style="color:#1155cc">here</span></a>&nbsp;as a sort of cautionary warning from legendary investor Howard Marks.</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">That&rsquo;s all we have for you today, folks! Let us know if you have any thoughts, comments, or concerns (we sure do, re: this entire brief)</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Your boys in the trenches,</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">Nick + Mark</span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">1.&nbsp;<a href="https://www.omfif.org/analysis/commentary/2018/april/china-downgrades-us-treasuries/" style="color:#1155cc" target="_blank">https://www.omfif.org/analysis/commentary/2018/april/china-downgrades-us-treasuries/</a></span></span></p>\r\n\r\n<p style="margin-left:0px; margin-right:0px"><span style="color:#222222"><span style="background-color:#ffffff">2.&nbsp;<a href="https://www.zerohedge.com/news/2018-04-04/boj-goes-record-etf-buying-spree-prevent-market-rout" style="color:#1155cc" target="_blank">https://www.zerohedge.com/news/2018-04-04/boj-goes-record-etf-buying-spree-prevent-market-rout</a></span></span></p>',updated:"2018-04-17T02:40:46.251449Z",fields:{slug:"Edition-19",date:"(4/11/2018)"}}},pathContext:{slug:"Edition-19"}}}});
//# sourceMappingURL=path---edition-19-03fa42588b258980d520.js.map